import { RouterModule } from '@angular/router';
import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { SharedModule } from 'app/shared/shared.module';
import { ScheduleComponent } from './schedule.component';
import { scheduleRoute } from './schedule.route';
import { ConfirmDialogModule } from 'primeng/confirmdialog';
import { ConfirmationService } from 'primeng/api';

import { ScheduleMaintainComponent } from './schedule-maintain.component';
import { ScheduleAdhocDialogComponent } from './schedule-adhoc-dialog.component';
import { TabViewModule } from 'primeng/tabview';
import { DialogModule } from 'primeng/dialog';
import { RadioButtonModule } from 'primeng/radiobutton';
import { BlockUIModule } from 'primeng/blockui';
import { InputNumberModule } from 'primeng/inputnumber';
import { MultiSelectModule } from 'primeng/multiselect';
import { DropdownModule } from 'primeng/dropdown';
import { CardModule } from 'primeng/card';
import { InputTextModule } from 'primeng/inputtext';
import { ProgressSpinnerModule } from 'primeng/progressspinner';
import { ProgressBarModule } from 'primeng/progressbar';
import { CalendarModule } from 'primeng/calendar';
import { TableModule } from 'primeng/table';
import { NgConnectModule } from 'app/ng-connect';

@NgModule({
  declarations: [ScheduleComponent, ScheduleMaintainComponent, ScheduleAdhocDialogComponent],
  imports: [
    CommonModule,
    SharedModule,
    NgConnectModule,
    ConfirmDialogModule,
    DialogModule,
    TabViewModule,
    RadioButtonModule,
    BlockUIModule,
    MultiSelectModule,
    InputNumberModule,
    CardModule,
    ProgressSpinnerModule,
    DropdownModule,
    InputTextModule,
    ProgressBarModule,
    CalendarModule,
    TableModule,
    RouterModule.forChild(scheduleRoute)
  ],
  providers: [ConfirmationService],
})
export class ScheduleModule {}
